import React from "react";
import { Link } from "react-router-dom";
import "../Css/ItemList.css"

const Item = ({ prenda }) => {

    return (
        <div>
            <Link to={`/prenda/${prenda.id}`}>
                <p> {prenda.nombre}</p>
                <p> precio: {prenda.precio}$</p>
                <img
                    className="remera"
                    src={prenda.imagen}
                />
                <br />
            </Link>
        </div>
    )
}
export default Item;
